import "./App.css";

let data = [
  {
    id: "84e96018-4022-434e-80bf-000ce4cd12b8",
    title: "BMX Rampage: 2021 Highlights",
    channel: "Red Cow",
    image: "https://i.imgur.com/l2Xfgpl.jpg",
  },
];

function App() {
  return (
    <div>
      <Details name={data[0]} />
    </div>
  );
}

function Details(props) {
  console.log(props.name);

  return (
    <div>
      <h2>{props.name}</h2>
    </div>
  );
}

export default App;
